var app=app||{};var TodoList=Backbone.Collection.extend({model:app.Todo,localStorage:new Backbone.localStorage("todos-backbone"),completed:function(){return this.filter(function(a){return a.get("completed")})},remaining:function(){return this.without.apply(this,this.completed())},nextOrder:function(){if(!this.length){return 1}},comparator:function(a){return a.get("order")}});app.Todos=new TodoList();